import React from 'react';
import classes from './Post.module.css';

const Post = (props) => {
    return(

    <div className={classes.content}>
        
        
       
       
        
        
        <div className={classes.item}><img src={props.ava}></img></div>
          {props.message}
          <div></div><span>Like {props.like}</span>
          
      </div>
    )
}

export default Post;
